import Categories from "./components/Categories";
import Header from "./components/Header";
import Sort from "./components/Sort";
import PizzaCard from "./components/PizzaCard/PizzaCard";
import "./scss/app.scss";
import { useEffect, useState } from "react";
import { useAxios } from "./hooks/useAxios";
import PizzaService from "./API/PizzaService";
import PizzaSkeletonCard from "./components/PizzaCard/PizzaSkeletonCard";
import { Routes, Route } from "react-router-dom";

function App() {
  const [pizzas, setPizzas] = useState([]);

  const [axiosPizzas, isLoadingPizzas, errorPizzas] = useAxios(async () => {
    const response = await PizzaService.getAll();
    console.log(response.data);
    setPizzas(response.data);
  });
  useEffect(() => {
    axiosPizzas();
  }, []);

  return (
    <div className="wrapper">
      <Header />
      <div className="content">
        <div className="container"></div>
      </div>
    </div>
  );
}

export default App;
